const start = (fetch, cb, interval) => {
  const f = () => {
    fetch().then(data => {
      cb(data)
    })
  }
  // Run it once without delay
  f()
  return setInterval(f, interval)
}

const stop = (poll) => {
  clearInterval(poll)
}

module.exports = {start, stop}

let datadeer = require('datadeer-core')
let log = require('./lib/logger.js')
let { loadPlugin } = require('./lib/plugin-loader.js')
const Server = require('./lib/Server')

/**
 * @typedef {Object} RaftConfig
 * @property {PluginConfig[]} [plugins] - List of plugins to apply
 * @property {PluginConfig[]} [dataSources] - Functionally the same as plugins, useful for logically separating data sources from plugins
 */

/**
 * @typedef {Object} PluginConfig
 * @property {function} [plugin] - Plugin to apply
 * @property {stirng} [pluginName] - Name of plugin to load and apply
 * @property {Object} [options] - Options to apply to plugin if loaded by pluginName
 */

/**
 * @class
 * Main raft class
 * @example
 * id
 */
class Raft {
  /**
   * Create an instance of Raft
   * @param {RaftConfig} config - Raft configuration
   */
  constructor (config) {
    const { plugins, dataInterval } = config
    const resolvedPlugins = this._resolvePlugins(plugins)
    log.debug({resolvedPlugins}, 'resolved')
    this.pluginConfigs = resolvedPlugins

    const dataFetcher = datadeer()
    this._applyPlugins(dataFetcher, resolvedPlugins)
    this.dataFetcher = dataFetcher

    const server = new Server({
      dataFetcher: dataFetcher.fetch.bind(dataFetcher),
      dataInterval: 3000
    })
    this.server = server

    this.dataInterval = dataInterval
  }

  /**
   * Resolve list of plugins. If a plugin is provided as a string, require that module.
   * @param {PluginConfig[]} pluginConfigs - List of plugins
   * @returns {PluginConfig[]} Resolved plugins
   */
  _resolvePlugins (pluginConfigs) {
    return pluginConfigs.map(pluginConfig => {
      log.debug({pluginConfig}, 'Resolving pluginConfig')
      if (typeof pluginConfig.plugin === 'string') {
        try {
          log.debug(`Plugin ${pluginConfig.plugin} provided as string, attemping to load`)

          const loadedPlugin = loadPlugin(pluginConfig.plugin)
          const _pluginConfig = Object.assign({}, pluginConfig, {plugin: loadedPlugin})
          log.debug({ _pluginConfig }, 'Plugin loaded successfully')
          return _pluginConfig
        } catch (e) {
          log.error(e)
          log.error(e.errors)
        }
      } else {
        return pluginConfig
      }
    })
  }

  /**
   * Apply pluginConfigs to a data fetcher
   * @param {DataDeerCore} dataFetcher - DataDeerCore to apply plugin to
   * @param {PluginConfig[]} pluginConfigs - Plugins to apply
   */
  _applyPlugins (dataFetcher, pluginConfigs) {
    pluginConfigs.forEach(pluginConfig => {
      log.debug({pluginConfig}, 'Attemping to apply plugin')
      dataFetcher.use(pluginConfig)
      log.debug({pluginConfig}, 'Plugin applied')
    })
  }

  start () {
    return this.server.start()
  }
}

module.exports = Raft

let express = require('express')
let exphbs = require('express-handlebars')
let morgan = require('morgan')
let log = require('./logger')
const DataPoll = require('./DataPoll')

class Server {
  constructor ({dataFetcher, dataInterval}) {
    console.log(dataFetcher.toString())
    this.dataFetcher = dataFetcher
    this.app = this._createApp()
  }

  _createApp () {
    const app = express()
    app.use(morgan('combined'))

    app.engine('html', exphbs({
      defaultLayout: false,
      extname: '.html'
    }))

    app.set('views', './public')
    app.set('view engine', 'html')

    app.use('/static', express.static('./public'))

    app.get('/*', (req, res) => {
      console.info(this.data)
      res.render(req.params['0'] || 'index', this.data)
    })
    return app
  }

  /**
   * Start polling for data and update
   */
  _startPolling () {
    const dataInterval = this.dataInterval || 4000
    this.poll = DataPoll.start(this.dataFetcher, data => {
      this.setData(data)
    }, dataInterval)
  }

  setData (data) {
    log.info(data, 'Setting server data')
    this.data = data
  }

  start () {
    this._startPolling()

    return new Promise((resolve, reject) => {
      this.app.listen(3000, () => {
        log.info({port: 3000}, 'Listening on 3000!')
      })
    })
  }
}

module.exports = Server

const log = require('./logger')
const PLUGIN_PREFIX = 'datadeer-plugin-'

function _ensurePrefix (prefix, plugin) {
  return plugin.startsWith(prefix)
    ? plugin
    : prefix + plugin
}

const makeError = {
  noFetch (plugin) {
    return new Error(`${plugin} does not implement 'fetch' function`)
  }
}

function _verifyPluginCompat (plugin) {
  const errors = []
  if (typeof plugin !== 'function') {
    errors.push(makeError.noFetch(plugin.filename))
  }
  return errors
}

function tryRequire (id, req) {
  log.debug({id}, `Attempting to require`)
  try {
    const _module = req(id)
    log.debug(`Module ${id} found`)
    return _module
  } catch (err) {
    log.error({err}, `Could not load module ${id}`)
  }
}

function loadPlugin (pluginIdentifier) {
  log.debug(`Attemping to load plugin ${pluginIdentifier}`)
  const plugin = tryRequire(pluginIdentifier, require) ||
    tryRequire(_ensurePrefix(PLUGIN_PREFIX, pluginIdentifier), require)
  if (!plugin) {
    const err = new Error(`${pluginIdentifier} module could not be found`)
    err.errors = []
    throw err
  }
  return plugin
}

module.exports = {
  _verifyPluginCompat,
  loadPlugin
}
